import { useEffect } from "react";
import FileDisplay from "../table";

const ConfirmatoryPage = ({ step, setStep, userDetails, files }) => {
  const { name, address, email, phoneNumber } = userDetails[0];

  return (
    <>
      <h2>USER DETAILS FROM CONFIRMATPRY PAGE</h2>

      <FileDisplay libraryFiles={files} showCheckbox={false} />
      <p>name: {name}</p>
    </>
  );
};

export default ConfirmatoryPage;
